svg.script:
clock8 = {

  menu: {
    'Tick': {
      eventName: 'clock8_tick',
      applicable: (elem) => {
        return elem.querySelector('#pie8').style['opacity'] !== '1'
      },
      uiLabel: (elem) => { return 'Tick clock forward' },
    },
    'Red': {
      eventName: 'colorRed',
      applicable: (elem) => {
        console.log(elem.querySelector('#bg').style['fill'])
        return elem.querySelector('#bg').style['fill'] !== 'rgb(255, 0, 0)'
      },
      uiLabel: (elem) => { return 'Change Color To Red' },
    },
  },

  initialize: function(elem) {
    elem.addEventListener( 'colorRed', (evt) => {
      elem.querySelector('#bg').style['fill'] = '#ff0000'
    } )
    elem.addEventListener( 'clock8_tick', (evt) => {
      if(elem.querySelector('#pie1').style['opacity'] !== '1') {
        elem.querySelector('#pie1').style['opacity'] = 1
      } else if(elem.querySelector('#pie2').style['opacity'] !== '1') {
        elem.querySelector('#pie2').style['opacity'] = 1
      } else if(elem.querySelector('#pie3').style['opacity'] !== '1') {
        elem.querySelector('#pie3').style['opacity'] = 1
      } else if(elem.querySelector('#pie4').style['opacity'] !== '1') {
        elem.querySelector('#pie4').style['opacity'] = 1
      } else if(elem.querySelector('#pie5').style['opacity'] !== '1') {
        elem.querySelector('#pie5').style['opacity'] = 1
      } else if(elem.querySelector('#pie6').style['opacity'] !== '1') {
        elem.querySelector('#pie6').style['opacity'] = 1
      } else if(elem.querySelector('#pie7').style['opacity'] !== '1') {
        elem.querySelector('#pie7').style['opacity'] = 1
      } else if(elem.querySelector('#pie8').style['opacity'] !== '1') {
        elem.querySelector('#pie8').style['opacity'] = 1
      }
    } )
    elem.querySelector('#pie1').style['opacity'] = 0
    elem.querySelector('#pie2').style['opacity'] = 0
    elem.querySelector('#pie3').style['opacity'] = 0
    elem.querySelector('#pie4').style['opacity'] = 0
    elem.querySelector('#pie5').style['opacity'] = 0
    elem.querySelector('#pie6').style['opacity'] = 0
    elem.querySelector('#pie7').style['opacity'] = 0
    elem.querySelector('#pie8').style['opacity'] = 0
  },

}
